            __builder.AddMarkupContent(0, "<div class=\"container-fluid bg background-overlay\"><div class=\"container-fluid \"><div class=\"container \"><div class=\"row intro\"><div class=\"col-lg-6\"><div class=\"firstText\"><div class=\"container\"><span class=\"heading-title\">System integration, specialløsning og driftsassistance</span></div></div>\r\n                    <div class=\"headText\"><div class=\"container\"><h1 class=\"heading-title\"><strong style=\"font-weight: 400;\">Softnotik Aps</strong> er med til at fremtidssikre jeres softwareløsninger</h1></div></div>\r\n                    <div class=\"divider\"></div>\r\n                    <div class=\"heading\"><div class=\"container\"><p><span class=\"heading-title\">\r\n                                    Vi hjælper virksomheder med de tekniske problemstillinger. Har de behov for hjælp til udvikling og implementering af system integrationer til Umbraco, Magento og andre CMS-løsninger, så er vi behjælpelig!\r\n                                    Vi hjælper med automatisering af processer og tests, for dermed at udvikle og fremtidssikre løsninger effektivt.\r\n                                    Vi har over 10 års erfaring med integrationsudvikling til både CMS systemer og special applikationsløsninger i .NET.\r\n                                </span></p></div></div>\r\n\r\n                    <section class=\"inner-section\"><div class=\"container\"><div class=\"row\"><div class=\"elementor-widget-wrap\"><div class=\"align-left mobile-align-center\"><div class=\"container\"><div class=\"button-wrapper\"><a href=\"../services/system-integration\" target=\"_blank\" class=\"btn btn-success\"><span class=\"button\"><span class=\"button-text\">Læs mere om Integrations muligheder</span></span></a></div></div></div></div></div></div></section></div>\r\n                <div class=\"col-lg-6\"><div class=\"contactForm\"><div class=\"elementor-widget-wrap\"><div class=\"heading\"><div class=\"container\"><h2 c