"form-control\" placeholder=\"Indtast email her\" required=\"required\" aria-required=\"true\"></div></div></div>\r\n                                            <div class=\"form-group\"><label for=\"phone\">Telefon</label><input type=\"text\" name=\"form_fields[phone]\" id=\"phone\" class=\"form-control\" placeholder=\"Indtast telefon her\" required=\"required\" aria-required=\"true\"></div>\r\n                                            <div class=\"form-group\"><label for=\"message\" class=\"label\">Besked</label><textarea class=\"form-control\" name=\"form_fields[message]\" id=\"message\" rows=\"4\" placeholder=\"indtast besked her\" required=\"required\" aria-required=\"true\"></textarea></div>\r\n                                            <div class=\"recaptcha_v3-inline\"><div class=\"field\" id=\"form-field-field_5c46add\"><div class=\"g-recaptcha\" data-sitekey=\"6LcQI-EUAAAAAEssLsaWyq7GBKGImxERLEB-Heho\" data-type=\"v3\" data-action=\"Form\" data-badge=\"inline\" data-size=\"invisible\"></div></div></div>\r\n                                            <div class=\"enableGDPR col-lg-12\"><div class=\"inline\"><span class=\"option\"><input type=\"checkbox\" value=\"Tryk her for at accepter vores privatlivspolitik- og persondatapolitik for opbevaring af formular dataen, som du kan &lt;a target=&quot;_blank&quot; href=&quot;https://softnotik.dk/privatlivspolitik/&quot; style=&quot;color: #fff; text-decoration:underline;&quot;&gt;læse om ved at trykke her&lt;/a&gt;.\" id=\"form-field-enableGDPR-0\" name=\"form_fields[enableGDPR]\">\r\n                                                        <label for=\"form-field-enableGDPR-0\">Tryk her for at accepter vores privatlivspolitik- og persondatapolitik for opbevaring af formular dataen, som du kan <a target=\"_blank\" href=\"https://softnotik.dk/privatlivspolitik/\" style=\"color: #fff; text-decoration:underline;\">læse om ved at trykke her</a>.</label></span></div></div>\r\n                                            <br>\r\n                                            <div class=\"submit\"><button type=\"submit\" class=\"btn btn-success btn-block\" id=\"sendContactInfo\"><span><span class=\"button-text\">SEND</span></span></button></div></div></form></div></div></div></div></div></div></div>\r\n        <section class=\"section-full_width\"><div class=\"container \"><div class=\"row\"><div class=\" topBoxs\"><div class=\"spacer\"></div>\r\n                        <section class=\"inner-section section-boxed\"><div class=\"container\"><div class=\"row\"><div class=\"col-lg-4\"><div class=\"container\"><div class=\"box-wrapper\"><div class=\"icon-box-icon\"><span class=\"icon\"><i class=\"fas fa-gears\"></i></span></div>\r\n                                                <div class=\"content\"><h2 class=\"title\"><span>Systemintegration til standardløsninger</span></h2>\r\n                                                    <p class=\"description\">\r\n                                                        Vi rådgiver, udvikler og implementerer system integrationer på følgende CMS og webshop løsninger.<br><br>\r\n                                                        <strong>CMS løsninger</strong><br>\r\n                                                        <a href=\"https://umbraco.com\" target=\"_blank\">Umbraco</a> eller <a href=\"https://wordpress.org\" target=\"_blank\">WordPress</a>\r\n                                                        <br><br>\r\n                                                        <strong>E-commerce / Webshop løsninger</strong><br>\r\n                                                        <a href=\"https://www.nopcommerce.com/\">nopCommerce</a>, <a href=\"https://www.ucommerce.dk\">uCommerce</a>, <a href=\"https://www.dandomain.dk\">DanDomain</a>,\r\n                                                        <a href=\"https://magento.com\" target=\"_blank\" style=\"white-space: nowrap;\">Magento 2</a>, <a href=\"https://woocommerce.com\" target=\"_blank\">WooCommerce</a>\r\n                                                        <br><br>\r\n                                                        <a href=\"/services/system-integration\">Læs mere...</a></p></div></div></div></div>\r\n                                    <div class=\"col-lg-4\"><div class=\"container\"><div class=\"box-wrapper\"><div class=\"icon-box-icon\"><span class=\"icon\"><i class=\"fas fa-code\"></i></span></div><div class=\"content\"><h2 class=\"title\"><span>Software outsourcing &amp;<br>specialløsninger</span></h2>\r\n                                                    <p class=\"description\">\r\n                                                        Vi udvikler, konfigurer og implementerer specialløsninger, der hvor standardprodukter kommer til kort og der er behov for en kundetilpasset løsning. <br>\r\n                                                        Vi udvikler primært i teknologierne .NET og C#. Sekundært PHP, Node.js og Phalcon.\r\n                                                        <br><br>\r\n                                                        <a href=\"/services/applikationsudvikling\">Læs mere...</a></p></div></div></div></div>\r\n                                    <div class=\"col-lg-4\"><div class=\"container\"><div class=\"box-wrapper\"><div class=\"icon-box-icon\"><span class=\"icon\"><i aria-hidden=\"true\" class=\"fas fa-server\"></i></span></div>\r\n                                                <div class=\"content\"><h2 class=\"title\"><span>Driftsassistance til<br> Windows Server og Azure</span></h2>\r\n                                                    <p class=\"description\">\r\n                                                        Vi har erfaring med fundamental software driftsassistance til virtualisering, webdrift, MySQL/SQL databaser og vedligeholdelse af Windows servere og Azure Cloud tjenester.\r\n                                                        Vi hjælper gerne med at sikre den daglige drift af udviklings- og produktions miljø.\r\n                                                        <br><br>\r\n                                                        <a href=\"/services/driftsassistance\">Læs mere...</a></p></div></div></div></div></div></div></section>\r\n                        <div class=\"spacer\"></div></div></div></div></section>\r\n\r\n        <section class=\"section-boxed\"><div class=\"container\"><div class=\"row\"><div class=\"col-lg-12\"><section class=\"inner-section\"><div class=\"container\"><div class=\"row\"><div class=\"col-lg-12\"><div class=\"container\"><h2 class=\"middle-heading-title\">Vi har før arbejdet med</h2></div></div></div></div></section>\r\n\r\n                        <section class=\"inner-section section-boxed\"><div class=\"container\"><div class=\"row\"><div class=\"col-lg-3\"><div class=\"text-editor\"><div class=\"container\"><div class=\"text-editor clearfix\"><table class=\"case\" style=\"border: 0;\"><tbody><tr><td style=\"border: 0;\"><img loading=\"lazy\" class=\"alignnone wp-image-1102\" style=\"-webkit-filter: drop-shadow(8px 8px 5px rgba(0,0,0,0.3));\" src=\"https://softnotik.dk/wp-content/uploads/2020/04/logo-microsoft-nav-300x150.png\" alt=\"nav logo\" width=\"242\" height=\"121\" srcset=\"https://softnotik.dk/wp-content/uploads/2020/04/logo-microsoft-nav-300x150.png 300w, https://softnotik.dk/wp-content/uploads/2020/04/logo-microsoft-nav.png 460w\" sizes=\"(max-width: 242px) 100vw, 242px\"></td></tr>\r\n                                                            <tr><td><strong style=\"display: block;\">\r\n                                                                        Applikationsudvikling med integration til\r\n                                                                        Microsoft Dynamic Nav\r\n                                                                    </strong><br>Vi har før arbejdet med special udvikling, hvor vi hjalp med vedligeholdelse, applikationsudvikling og integration til Navision.\r\n                                                                    Opgaven var at automatisere bogføring af tilsendte fakturaer. Vi hjalp med dele af bogføringsprocesserne blev automiserede i forhold til udlæg og kvitteringer <span style=\"word-spacing: normal;\">fra medarbejdere med teamets eget udviklet mobil- og web applikation til forskellige virksomheder.</span></td></tr></tbody></table></div></div></div></div>\r\n                                    <div class=\"col-lg-3\"><div class=\"text-editor\"><div class=\"container\"><div class=\"text-editor clearfix\"><table class=\"case\"><tbody><tr><td><img loading=\"lazy\" class=\"image-dd\" src=\"https://softnotik.dk/wp-content/uploads/2020/04/DanDomain-logo_RGB-300x55.png\" alt=\"DanDomain\" width=\"224\" height=\"41\" srcset=\"https://softnotik.dk/wp-content/uploads/2020/04/DanDomain-logo_RGB-300x55.png 300w, https://softnotik.dk/wp-content/uploads/2020/04/DanDomain-logo_RGB-1024x189.png 1024w, https://softnotik.dk/wp-content/uploads/2020/04/DanDomain-logo_RGB-768x142.png 768w, https://softnotik.dk/wp-content/uploads/2020/04/DanDomain-logo_RGB-1536x283.png 1536w, https://softnotik.dk/wp-content/uploads/2020/04/DanDomain-logo_RGB-2048x378.png 2048w\" sizes=\"(max-width: 224px) 100vw, 224px\"></td></tr>\r\n                                                            <tr><td><strong style=\"display: block;\">Resurs Bank integration til DanDomain</strong><br>Vi har før hjulpet med udvikling af en DanDomain app. App’en integrer Resurs Bank til forskellige DanDomain webshopløsninger, så kunder af en webshop kan låne penge via webshoppen. Webshoppens ejer får på denne måde et bedre overblik over de indkomne betalinger.\r\n                                                                </td></tr></tbody></table></div></div></div></div>\r\n                                    <div class=\"col-lg-3\"><div class=\"text-editor\"><div class=\"container\"><div class=\"text-editor clearfix\"><table class=\"case\"><tbody><tr><td><img loading=\"lazy\" class=\"image-wp\" src=\"https://softnotik.dk/wp-content/uploads/2020/03/wordpress-300x300.png\" alt width=\"85\" height=\"85\" srcset=\"https://softnotik.dk/wp-content/uploads/2020/03/wordpress-300x300.png 300w, https://softnotik.dk/wp-content/uploads/2020/03/wordpress-150x150.png 150w, https://softnotik.dk/wp-content/uploads/2020/03/wordpress.png 500w\" sizes=\"(max-width: 85px) 100vw, 85px\"></td></tr>\r\n                                                            <tr><td><strong style=\"display: block;\">Vedligeholdelse og support til Dansk Blindesamfunds Ungdom</strong><br>Vi har et samarbejde med videreudvikling og vedligeholdelse af deres hjemmeside, samt support af Microsoft Office 365. Deres hjemmeside indeholder generel information, nyheder, arrangementer, podcasts og kontakt som de også selv kan administrer med et kontrolpanel.\r\n                                                                </td></tr></tbody></table></div></div></div></div>\r\n                                    <div class=\"col-lg-3\"><div class=\"text-editor\"><div class=\"container\"><div class=\"text-editor clearfix\"><table class=\"case\"><tbody><tr><td><img loading=\"lazy\" class=\"image-azu\" style=\"-webkit-filter: drop-shadow(8px 8px 5px rgba(0,0,0,0.3)); display: block;\" src=\"https://softnotik.dk/wp-content/uploads/2020/03/1200px-Microsoft_Azure_Logo.svg_-300x87.png\" alt=\"Azure\" width=\"176\" height=\"51\" srcset=\"https://softnotik.dk/wp-content/uploads/2020/03/1200px-Microsoft_Azure_Logo.svg_-300x87.png 300w, https://softnotik.dk/wp-content/uploads/2020/03/1200px-Microsoft_Azure_Logo.svg_-1024x296.png 1024w, https://softnotik.dk/wp-content/uploads/2020/03/1200px-Microsoft_Azure_Logo.svg_-768x222.png 768w, https://softnotik.dk/wp-content/uploads/2020/03/1200px-Microsoft_Azure_Logo.svg_.png 1200w\" sizes=\"(max-width: 176px) 100vw, 176px\"></td></tr>\r\n                                                            <tr><td><strong style=\"display: block;\">Azure Devops &amp; Azure Portal</strong><br>Vi har før arbejdet med automatisering interne processer til softwareudvikling, test og deployment af forskellige applikationsløsninger til Azure Devops – også kaldet Continuous Integration, Continuous Delivery og Continuous Deployment.\r\n                                                                </td></tr></tbody></table></div></div></div></div></div></div></section></div>\r\n                    <div class=\"spacer\"></div>\r\n                    <section class=\"section-boxed\"><div class=\"container \"><div class=\"row\"><div class=\"col-lg-12\"><div class=\"heading\"><div class=\"container\"><h2 class=\"middle-heading-title\">\r\n                                                Partners\r\n                                                <small style=\"font-size: 16px;margin: 5px 0 0 0; padding: 0;display:block;\">Vi samarbejder med</small></h2></div></div></div></div></div></section>\r\n                    <section class=\"section-boxed\"><div class=\"container\"><div class=\"row\"><div class=\"col-lg-4\"><div class=\"text-editor\"><div class=\"container\"><div class=\"text-editor clearfix\"><p><a href=\"https://umbraco.com\" target=\"_blank\" rel=\"noopener\"><img loading=\"lazy\" class=\"wp-image-1191 \" src=\"https://softnotik.dk/wp-content/uploads/2020/09/Registered_Partner_logo_transparent_background-300x90.png\" alt width=\"237\" height=\"71\" srcset=\"https://softnotik.dk/wp-content/uploads/2020/09/Registered_Partner_logo_transparent_background-300x90.png 300w, https://softnotik.dk/wp-content/uploads/2020/09/Registered_Partner_logo_transparent_background.png 375w\" sizes=\"(max-width: 237px) 100vw, 237px\"></a></p></div>\r\n                                            <div class=\"elementor-element elementor-element-7845d48 elementor-widget elementor-widget-text-editor\" data-id=\"7845d48\" data-element_type=\"widget\" data-widget_type=\"text-editor.default\"><div class=\"elementor-widget-container\"><div class=\"elementor-text-editor elementor-clearfix\"><p><a style=\"color: #000; text-decoration: underline;\" href=\"https://umbraco.com/training/certified-developers/developer/?id=ff9fd2f1-2689-4406-8307-3b6fa9b4c476&amp;_ga=2.259050121.226561453.1613461611-1192273237.1609853162&amp;fbclid=IwAR1qcZBZTgksDrYd44jvTyujEW6IGln0nleOHlrdt53iwpkhQFazGXdd2to\" target=\"&quot;_blank\">Find&nbsp;<strong>Umbraco Ekspert</strong> certificering her.</a></p></div></div></div></div></div></div>\r\n                                <div class=\"col-lg-4\"><div class=\"text-editor\"><div class=\"container\"><div class=\"text-editor clearfix\"><a style=\"display: block; padding-top: 5px;\" href=\"https://vorteil.io\" target=\"_blank\" rel=\"noopener\"><img loading=\"lazy\" class=\"wp-image-1155 \" src=\"https://softnotik.dk/wp-content/uploads/2020/09/logo-vorteil-black.png\" alt width=\"170\" height=\"41\"></a></div></div></div></div>\r\n                                <div class=\"col-lg-4\"><div class=\"text-editor\"><div class=\"container\"><div class=\"text-editor clearfix\"><a href=\"https://www.microsoft.com/en-us/solution-providers/partnerdetails/softnotik_8d3314ca-0b7e-4313-9c4a-7d5759cb80be/064c308a-a76f-4e81-abfa-2ca149005cb0\" target=\"_blank\" rel=\"noopener\"><img loading=\"lazy\" class=\"image-micro\" src=\"https://softnotik.dk/wp-content/uploads/2020/09/logo-removebg-300x196.png\" alt width=\"256\" height=\"167\" srcset=\"https://softnotik.dk/wp-content/uploads/2020/09/logo-removebg-300x196.png 300w, https://softnotik.dk/wp-content/uploads/2020/09/logo-removebg.png 617w\" sizes=\"(max-width: 256px) 100vw, 256px\"></a></div></div></div></div></div></div></section></div></div></section>\r\n        <section class=\"section-full_width\"><div class=\"container-fluid\"><div class=\"row\"><div class=\"col-lg-6\"><div class=\"spacer\"></div>\r\n                        <section class=\"section-boxed\"><div class=\"container\"><div class=\"row\"><div class=\"col-lg-12\"><div class=\"heading\"><div class=\"container\"><span class=\"heading-title\">Hvorfor vælge SOFTNOTIK, som webshop leverandør?</span></div></div>\r\n                                        <div class=\"heading\"><div class=\"container\"><h2 class=\"heading-title-2\">Webshopløsning</h2></div></div>\r\n                                        <div class=\"divider2\"></div>\r\n                                        <div class=\"text\"><div class=\"container\"><div class=\"text clearfix\"><p>\r\n                                                        Vi kan hjælpe dig med at rådgive om den rigtige løsning og få den implementeret. Vores speciale er integrationer af forskellige løsninger og systemer, derved kan jeg hjælpe med at fange de risici der er i jeres forretning, inden det er for sent.<br>\r\n                                                        <span style=\"word-spacing: normal;\">Vi har en bred </span>fundamental erfaring med webshopløsninger, som <a href=\"https://ucommerce.net\" target=\"_blank\" rel=\"noopener\">uCommerce</a>, <a href=\"https://www.nopcommerce.com\" target=\"_blank\" rel=\"noopener\">nopCommerce</a>, <a href=\"https://magento.com/\" target=\"_blank\" rel=\"noopener\">Magento 2</a>, <a href=\"https://www.dandomain.dk/\" target=\"_blank\" rel=\"noopener\">DanDomain</a> og <a href=\"https://woocommerce.com/\" target=\"_blank\" rel=\"noopener\">WooCommerce</a>.\r\n                                                    </p>\r\n                                                    <p><strong>SOFTNOTIK hjælper med</strong></p>\r\n                                                    <ul><li>Valg af webshopplatform, samt nødvendige integrationer til jeres eksisterende eller fremtidige systemer.</li>\r\n                                                        <li>Driftsassistance og vedligeholdelse af eksisterende webshopløsninger.</li>\r\n                                                        <li>Nyudvikling af webshopløsninger på tværs af enheder.</li></ul></div></div></div>\r\n                                        <div class=\"spacer\"></div>\r\n                                        <div class=\"button\"><div class=\"elementor-widget-container\"><div class=\"button-wrapper\"><a href=\"/services/hjemmeside-loesning/\" class=\"btn btn-outline-secondary\"><span class=\"button-content\"><span class=\"button-text\">Læs mere</span></span></a></div></div></div></div></div></div></section></div>\r\n                    <div class=\"col-lg-6\"><div class=\"element\"><div class=\"spacer\"></div></div></div></div></div></section>\r\n\r\n        <section class=\"section-full_width\"><div class=\"container-fluid\"><div class=\"row\"><div class=\"col-lg-6\"><div class=\"element2\"></div></div>\r\n                    <div class=\"col-lg-6\"><section class=\"section-boxed\"><div class=\"spacer\"></div>\r\n                            <div class=\"container\"><div class=\"row\"><div class=\"col-lg-12\"><div class=\"heading\"><div class=\"container\"><span class=\"heading-title\">Om SOFTNOTIK</span></div></div>\r\n                                        <div class=\"heading\"><div class=\"container\"><h2 class=\"heading-title-2\"><i>\"Bred erfaring med forskellige IT systemer\"</i></h2></div></div>\r\n                                        <div class=\"divider2\"></div>\r\n                                        <div class=\"text\"><div class=\"container\"><div class=\"text clearfix\"><p>\r\n                                                        Hos Softnotik Aps&nbsp;<span style=\"word-spacing: normal;\">tilbyder vi ydelser i forbindelse med </span>udvikling af systemintegration, specialløsninger og web i samarbejde med kunderne. F. eks. inden for integration af data, betalingsløsninger, økonomisystemer og specialløsninger til eksempelvis administration, webshops og webapplikationer<br>\r\n                                                        <span style=\"word-spacing: normal;\">Vi brænder for at arbejde med de tekniske problemstillinger, samt levere en seriøs og </span>professionel&nbsp;<span style=\"word-spacing: normal;\">løsning helt ud til slutkunden.&nbsp;</span></p></div></div></div>\r\n                                        <div class=\"spacer\"></div>\r\n                                        <div class=\"button\"><div class=\"container\"><div class=\"elementor-button-wrapper\"><a href=\"/om-softnotik/\" class=\"btn btn-outline-secondary\"><span class=\"content\"><span class=\"button-text\">Læs mere</span></span></a></div></div></div></div></div></div></section></div></div>\r\n                <div class=\"spacer\"></div></div></section>\r\n        <section class=\"section-boxed\"><div class=\"container-fluid\"><div class=\"row\"><section class=\"col-lg-12\"><div class=\"heading\"><div class=\"container\"><h2 class=\"middle-heading-title\">Referencer</h2></div></div>\r\n                        <div class=\"col-lg-12\"><div class=\"container\"><div class=\"row\"><article class=\"col-lg-3 thumbnail\"><a class=\"thumbnail__link\" href=\"https://softnotik.dk/work/minforening/\"><div class=\"post__thumbnail\"><img class=\"item__img\" src=\"https://softnotik.dk/wp-content/uploads/2021/03/MinForening-Logo-Hvid-30-1.png\" alt=\"min-forening\" loading=\"lazy\"></div></a></article>\r\n                                    <article class=\"col-lg-3 thumbnail\"><a class=\"thumbnail__link\" href=\"https://softnotik.dk/work/jan-joergensen/\"><div class=\"post__thumbnail\"><img class=\"item__img\" src=\"https://softnotik.dk/wp-content/uploads/2021/02/JJ_new_logo-1024x376.jpg\" alt=\"jan-joergensen\" loading=\"lazy\"></div></a></article>\r\n                                    <article class=\"col-lg-3 thumbnail\"><a class=\"elementor-post__thumbnail__link\" href=\"https://softnotik.dk/work/billigventilation-dk/\"><div class=\"post__thumbnail\"><img class=\"item__img\" src=\"https://softnotik.dk/wp-content/uploads/2021/02/Billig-Ventilation-Logo.png\" alt=\"